import{_ as a,o as e,c as t,e as o}from"./chunks/framework.mYMQfzZG.js";const l="/assets/photo_2021-11-18_16-.qWTZLnrR.jpg",r="/assets/photo_2021-11-18_16-1.Jh1CV-S5.jpg",i="/assets/photo_2021-11-18_16-2.ouwol4Zm.jpg",h="/assets/photo_2021-11-18_16-3.mg5IpWOb.jpg",s="/assets/photo_2021-11-18_16-4.StetCuck.jpg",x=JSON.parse('{"title":"СоШью","description":"Швейный коворкинг","frontmatter":{"title":"СоШью","description":"Швейный коворкинг","date":"2016-09-15","cover":"TLX-cDtNBIU.jpg","city":"г.  Москва","address":"Краснобогатырская улица 90с22, кабинет 203","place":"м. Преображенская площадь","coord":[55.78783649035841,37.703879985363024],"tel":"+7 (901) 585-52-42","hours":"Вт-Пт 11—19, Сб 12—18","status":"open","facebook":"cosewmoscow","vk":"cosew","instagram":"cosewmoscow","telegram":"cosew","youtube-channel":"Сошью"},"headers":[],"relativePath":"workshop/catalog/cosew/index.md","filePath":"workshop/catalog/cosew/index.md"}'),n={name:"workshop/catalog/cosew/index.md"},c=o('<p>Сошью — это открытая мастерская, где можно пошить в оборудованном пространстве, арендовать швейную машинку, получить консультацию мастера или научиться шить с нуля.</p><p>Мы помогаем тем, кто уже шьет и только хочет научиться шить. Создаем комфортные условия для кроя, шитья и общения.</p><h4 id="начинающим" tabindex="-1">Начинающим <a class="header-anchor" href="#начинающим" aria-label="Permalink to &quot;Начинающим&quot;">​</a></h4><p>Поможем погрузиться в мир шитья. Обратите внимание на наши курсы &quot;Введение в швейное мастерство&quot; и &quot;Оверлок и трикотаж&quot;. После них вы сможете приходить в мастерскую и самостоятельно шить под присмотром опытного мастера.</p><h4 id="продолжающим-и-выпускникам-курсов-шитья" tabindex="-1">Продолжающим и выпускникам курсов шитья <a class="header-anchor" href="#продолжающим-и-выпускникам-курсов-шитья" aria-label="Permalink to &quot;Продолжающим и выпускникам курсов шитья&quot;">​</a></h4><p>Если вы шьете дома сами или недавно закончили курсы шитья, то коворкинг это ваше место! Здесь вы сможете продолжить практику и не бояться совершить ошибку. Мы поможем не сбиться с пути и не потерять мотивацию.</p><h4 id="опытным-швеям-и-студентам-профильных-заведении" tabindex="-1">Опытным швеям и студентам профильных заведений <a class="header-anchor" href="#опытным-швеям-и-студентам-профильных-заведении" aria-label="Permalink to &quot;Опытным швеям и студентам профильных заведений&quot;">​</a></h4><p>Получите закрепленное место в комфортной мастерской в ЦАО. Такой формат подойдет вам, если дома работать неудобно или не хочется и нужно место для встречи с клиентами.</p><p><img src="'+l+'" alt=""><img src="'+r+'" alt=""><img src="'+i+'" alt=""></p><h3 id="что-можно-делать-в-мастерскои" tabindex="-1">Что можно делать в мастерской <a class="header-anchor" href="#что-можно-делать-в-мастерскои" aria-label="Permalink to &quot;Что можно делать в мастерской&quot;">​</a></h3><h4 id="аренда-и-помощь" tabindex="-1">Аренда и помощь <a class="header-anchor" href="#аренда-и-помощь" aria-label="Permalink to &quot;Аренда и помощь&quot;">​</a></h4><p>Прийти сшить или перешить вещь. Воспользоваться оборудованием, которого нет дома. Получить помощь и советы опытного мастера.</p><h4 id="индивидуальное-занятие" tabindex="-1">Индивидуальное занятие <a class="header-anchor" href="#индивидуальное-занятие" aria-label="Permalink to &quot;Индивидуальное занятие&quot;">​</a></h4><p>Персональное занятие поможет сосредоточиться на вашей задаче и получить максимум знаний от каждой встречи.</p><h4 id="обучение" tabindex="-1">Обучение <a class="header-anchor" href="#обучение" aria-label="Permalink to &quot;Обучение&quot;">​</a></h4><p>Следите за обновлением расписания и приходите на совместные пошивы или курсы.</p><h4 id="одежда-на-заказ" tabindex="-1">Одежда на заказ <a class="header-anchor" href="#одежда-на-заказ" aria-label="Permalink to &quot;Одежда на заказ&quot;">​</a></h4><p>Закажите одежду по своим эскизам и меркам. Шьем пальто, жакеты, брюки и юбки, платья – повседневные и вечерние. Цены не кусаются.</p><p><img src="'+h+'" alt=""><img src="'+s+'" alt=""></p><h2 id="здесь-есть-все-что-нужно-для-шитья" tabindex="-1">Здесь есть все, что нужно для шитья <a class="header-anchor" href="#здесь-есть-все-что-нужно-для-шитья" aria-label="Permalink to &quot;Здесь есть все, что нужно для шитья&quot;">​</a></h2><h4 id="консультации-технолога-швеиного-производства" tabindex="-1">Консультации технолога швейного производства <a class="header-anchor" href="#консультации-технолога-швеиного-производства" aria-label="Permalink to &quot;Консультации технолога швейного производства&quot;">​</a></h4><p>Поможем с примеркой, обработкой сложных деталей, скорректируем крой и посадку.</p><h4 id="удобства-недоступные-дома" tabindex="-1">Удобства, недоступные дома <a class="header-anchor" href="#удобства-недоступные-дома" aria-label="Permalink to &quot;Удобства, недоступные дома&quot;">​</a></h4><p>Парогенератор, большая гладильная доска, два стола для кроя</p><h4 id="швеиные-машины" tabindex="-1">Швейные машины <a class="header-anchor" href="#швеиные-машины" aria-label="Permalink to &quot;Швейные машины&quot;">​</a></h4><p>Швейные машины Astralux, Brother. Оверлок Janome и Bernetta.</p><h4 id="аксессуары" tabindex="-1">Аксессуары <a class="header-anchor" href="#аксессуары" aria-label="Permalink to &quot;Аксессуары&quot;">​</a></h4><p>Ножницы, иголки, булавки, линейки, лекала, колодки. Нитки, ткань и фурнитуру приносите с собой – расходные материалы не входят в цену аренды.</p><h4 id="распошивальная-машина-elna444" tabindex="-1">Распошивальная машина Elna444 <a class="header-anchor" href="#распошивальная-машина-elna444" aria-label="Permalink to &quot;Распошивальная машина Elna444&quot;">​</a></h4><p>Выполняет 14 разновидностей строчек – цепные стежки с правой, левой, центральной иглой, двойной шов – левый, правый, широкий, тройной распошивальный шов и др.</p><h2 id="вводные-занятия-по-воскресеньям" tabindex="-1">Вводные занятия по воскресеньям <a class="header-anchor" href="#вводные-занятия-по-воскресеньям" aria-label="Permalink to &quot;Вводные занятия по воскресеньям&quot;">​</a></h2><p>Каждое воскресенье мы проводим вводное занятие для тех, кто хочет освежить базовые знания о шитье. Не знает с чего начать и как подступиться к машинке. Какую ткань выбрать для изделия. Как грамотно снять мерки и многое другое.</p><h3 id="программа-интенсива" tabindex="-1">Программа интенсива: <a class="header-anchor" href="#программа-интенсива" aria-label="Permalink to &quot;Программа интенсива:&quot;">​</a></h3><ol><li>Снятие мерок с фигуры. Пропорции, особенности женской фигуры, нестандартные фигуры.</li><li>Материаловедение. Выбор ткани. Правила и способы раскладки выкроек на ткани, определение расхода ткани.</li><li>Машиноведение. Работа со швейной машиной. Устранение неполадок в работе швейной машины.</li><li>Машинные швы используемые при изготовлении одежды. Технология их выполнения. Технология утюжильных работ (ВТО).Мини-курс проведет технолог швейного производства, портная высшего разряда с опытом работы на производстве, пошиве вечерних платьев, индивидуальном пошиве.</li></ol><hr><h2 id="абонементы-и-цены" tabindex="-1">Абонементы и цены <a class="header-anchor" href="#абонементы-и-цены" aria-label="Permalink to &quot;Абонементы и цены&quot;">​</a></h2><h4 id="разовое-посещение" tabindex="-1">Разовое посещение <a class="header-anchor" href="#разовое-посещение" aria-label="Permalink to &quot;Разовое посещение&quot;">​</a></h4><p>Будьте у нас столько, сколько нужно</p><p><strong>900 рублей</strong></p><ul><li>Любой день</li><li>Место не закрепляется</li><li>Аксессуары - ножницы, линейки, мелки</li><li>Консультации мастера-технолога</li></ul><h4 id="абонемент-на-5-посещении" tabindex="-1">Абонемент на 5 посещений <a class="header-anchor" href="#абонемент-на-5-посещении" aria-label="Permalink to &quot;Абонемент на 5 посещений&quot;">​</a></h4><p>Действует 45 дней</p><p><strong>3500 рублей</strong></p><ul><li>Вторник-воскресенье с 11 до 19</li><li>Выделенное место</li><li>Хранение вещей</li><li>Аксессуары - ножницы, линейки, мелки</li><li>Консультации мастера</li></ul><h4 id="дневнои-абонемент-месяц" tabindex="-1">Дневной абонемент месяц <a class="header-anchor" href="#дневнои-абонемент-месяц" aria-label="Permalink to &quot;Дневной абонемент месяц&quot;">​</a></h4><p>Действует 30 дней с первого визита</p><p><strong>5500 рублей</strong></p><ul><li>Только будни с 11 до 19</li><li>Закрепленное место</li><li>Хранение вещей</li><li>Можно купить сейчас, а использовать позже. Срок действия считается от первого посещения.</li><li>Можно расширить абонемент до посещений в выходные +2000 рублей</li></ul>',48),d=[c];function p(u,_,m,q,b,f){return e(),t("div",null,d)}const g=a(n,[["render",p]]);export{x as __pageData,g as default};
